import React from 'react';
import {Route, Switch} from "react-router-dom"
import FbHeader from './FbHeader';
import FbLeftSlide from "./FbLeftSlide"
import FbRightSlide from "./FbRightSlide"
import Home from './Home';
import Marketplace from './Marketplace';
imp


const App = () => {
  return (
    <>
    <FbHeader/>
    <FbLeftSlide/>
    <FbRightSlide/>
      <Switch>
        <Route></Route>
      </Switch>
    </>
  )
}

export default App;
